INSERT INTO `translations` VALUES ('469', '2', '2', 'MNUUSER_TITLEMYNOTIFICATIONS', 'Ver sus notificaciones', '<div class=tooltips_title>Ver sus notificaciones</div><div class=tooltips_content> Visualizar todos los eventos que ocurren en tu cuenta, como comentar tus tag, invitaciones de amigos, enviado de tags privadas, entre otros.</div>', '2011-11-24 22:52:16', 'es');
